selector_to_html = {"a[href=\"#overdrive\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Overdrive<a class=\"headerlink\" href=\"#overdrive\" title=\"Link to this heading\">#</a></h2><p>Bueno, el requisito de la aplicaci\u00f3n se cumple con\n<a class=\"reference external\" href=\"https://www.overdrive.com/\">Overdrive</a>, una aplicaci\u00f3n que permite la\ngesti\u00f3n del pr\u00e9stamo de libros electr\u00f3nicos y audiolibros en las bibliotecas\nque tengan dispuesto espacio en esta plataforma. Ojo, no se trata de una\naplicaci\u00f3n general para audiolibros y libros, es solo para estos recursos en\nlas bibliotecas aliadas.</p><p>Para nosotros en Colombia, tenemos m\u00e1s bien pocas opciones. Podr\u00e1n explorar\nr\u00e1pidamente las bibliotecas aliadas, categorizadas por <em>Antioquia</em>, <em>Distrito\nCapital de Bogot\u00e1</em>, <em>Medell\u00edn</em> y <em>Valle del Cauca</em>. Para esta exploraci\u00f3n deben\ndirigirse a la opci\u00f3n \u00abAdministrar bibliotecas\u00bb, el signo \u00ab+\u00bb para agregar una\nnueva biblioteca y finalmente \u00abEXPLORAR BIBLIOTECAS\u00bb.</p>", "a[href=\"#fundacion-epm-red-de-bibliotecas\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Fundaci\u00f3n EPM - Red de bibliotecas<a class=\"headerlink\" href=\"#fundacion-epm-red-de-bibliotecas\" title=\"Link to this heading\">#</a></h2><p>No es que sea la \u00fanica opci\u00f3n, pero si es la opci\u00f3n para cualquier ciudadano\ncolombiano. La biblioteca de la Fundaci\u00f3n EPM es una biblioteca p\u00fablica y por\ntenes acceso a ella de una forma muy simple, inscribi\u00e9ndonos en un formulario\nweb, tras el cual tendremos nuestro usuario y contrase\u00f1a.</p><p>Este formulario se encuentra disponible en el sitio del\n<a class=\"reference external\" href=\"http://bibliotecasmedellin.gov.co/cms/servicios-en-linea/afiliacion/\">Sistema de Bibliotecas P\u00fablicas de Medell\u00edn</a>.\nEl \u00fanico pero, es estar forzado a diligenciar un n\u00famero de contacto fijo en una\n\u00e9poca donde es poco com\u00fan pero los datos no son validados para tener acceso (en\nmi caso registre el n\u00famero parcial de mi celular).</p>", "a[href=\"#a-escuchar\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">A escuchar<a class=\"headerlink\" href=\"#a-escuchar\" title=\"Link to this heading\">#</a></h2><p>Una vez tenemos los datos, agregamos la biblioteca de la Fundaci\u00f3n EPM,\nseleccionamos Red de Bibliotecas, ingresamos nuestros datos y procedemos a\nseleccionar el recurso que queremos prestar (en la pr\u00f3xima ocasi\u00f3n, accederemos\ndesde el men\u00fa lateral seleccionando la biblioteca). En este caso, mi\nrecomendaci\u00f3n de audiolibros con experiencia inmersiva (tipo radionovela).</p>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../../../../_images/overdrive-audiolibros-prestados.png\"><img alt=\"Lista de audiolibros prestados.\" src=\"../../../../_images/overdrive-audiolibros-prestados.png\" style=\"width: 89.5px; height: 159.25px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Lista de audiolibros prestados disponible en la estanter\u00eda.</span><a class=\"headerlink\" href=\"#id3\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#audiolibros-con-overdrive-y-biblioteca-epm\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Audiolibros con Overdrive y Biblioteca EPM<a class=\"headerlink\" href=\"#audiolibros-con-overdrive-y-biblioteca-epm\" title=\"Link to this heading\">#</a></h1><p>Vuelvo despu\u00e9s de un largo tiempo al blog, con el fin de compartirles una\nexcelente recomendaci\u00f3n para aprovechar sus tiempos de espera en transporte o\nen las eternas filas. Se trata de aprovechar el tiempo escuchando audiolibros.</p><p>Para esto, se requiere de dos elementos, uno es tener una aplicaci\u00f3n instalada\nen nuestro m\u00f3vil y adicional tener acceso a los recursos de la Biblioteca de la\nFundaci\u00f3n EPM.</p>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../../../_images/menu-lateral-overdrive.png\"><img alt=\"Men\u00fa lateral de Overdrive.\" src=\"../../../../_images/menu-lateral-overdrive.png\" style=\"width: 89.5px; height: 159.25px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Men\u00fa lateral de Overdrive con listado de bibliotecas agregadas.</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
